apan, Korea, and China, while Dregea is native to tropical and subtropical regions of Asia, including India, Nepal, Bhutan, Myanmar, Thailand, Laos, Cambodia, Vietnam, and southern China.'),(740,'Who else besides \'The Golden Jet\' was born in Point Anne, Ontario?','Wayne Cashman, former NHL player and coach, was also born in Point Anne, Ontario.'),(741,'Boggle is a word game originally distributed by a toy and game manufacturer that published more than how many games?','Boggle is a word game originally distributed by Parker Brothers, a toy and game manufacturer that has published more than 1,800 games.'),(742,'The attraction at universal studios that was based on \'The Tonight Show\' replaced an attraction that replaced an attraction based on what movie?','The attraction at Universal Studios Hollywood that replaced an attraction based on \'The Tonight Show with Jay Leno\' was \'The Wizarding World of Harry Potter.\' The attraction that was replaced by \'The Tonight Show\' was \'The Funtastic World of Hanna-Barbera,\' which was originally replaced by \'The Adventures of Conan: A Sword and Sorcery Spectacular.\''),(743,'Who holds the world record for jumping over 6 buses and appeared on the British television series \'The Jump\'?','The person who holds the world record for jumping over 6 buses and appeared on the British television series \'The Jump\' is American Olympic gold medalist and professional skier, Eddie \'The Eagle\' Edwards.'),(744,'St Dionis Backchurch was rebuilt after a major conflagration that consumed how many parish churches?','St Dionis Backchurch was rebuilt after the Great Fire of London in 1666, which consumed 87 parish churches in total.'),(745,'Which show which aired on NBC from September 22, 1994, to May 6, 2004, has the fifteenth episode entitled, \'The One with the Girl Who Hits Joey\'?','The show is \'Friends\'.'),(746,'Who directed the 1941 film based on the novel of the same name by Zane Grey starring an actor who was also an artist and 