s rock guitarist and singer known for hits such as \'Bad to the Bone\' and \'Move It On Over\'.'),(1006,'Dr Jan Schneider ran for United States Congress in Florid but lost twice to which Republican politician?','Dr. Jan Schneider lost twice to Republican Congressman Vern Buchanan in Florida\'s 13th Congressional district in 2006 and 2008.'),(1007,'What actor\'s debut film also starred an actor who received four National Film Awards and eight Filmfare Awards, as well as an Academy Award nomination?','The actor who made their debut and starred alongside an actor with the aforementioned credentials is none other than Anil Kapoor. Kapoor\'s debut film was \'Hamare Tumhare\' (1979) which also starred Bollywood legend, Balraj Sahni. Sahni was the recipient of four National Film Awards and eight Filmfare Awards, as well as an Academy Award nomination for Best Supporting Actor for his role in the Hollywood film \'Gandhi\' (1982).'),(1008,'Were The Bomb and Rolling Papers released in the same year?','No, they were not. \'The Bomb\' is a song by American rock band Pigeon John released on their 2006 album \'And the Summertime Pool Party,\' while \'Rolling Papers\' is the third studio album by American rapper Wiz Khalifa, released on March 29, 2011.'),(1009,'Michaël Llodra of France, called \'the best volleyer on tour\', defeated Juan Martín del Potro a professional of what nationality?','Juan Martin Del Potro is a professional tennis player from Argentina.'),(1010,'Are Parents and Madame Figaro published in the same country?','Both Parents and Madame Figaro are magazines that are published in France. However, Parents is a magazine that mainly focuses on topics related to parenting and family life, while Madame Figaro is a women\'s lifestyle magazine that covers a diverse range of topics including fashion, beauty, culture, and social issues.'),(1011,'What award does Crystal Palace F.C. present, first won by John McCormick and most recently by Wilfried Zaha?','The award that Cry