idor Isaac Rabi himself was awarded the Nobel Prize in Physics in 1944 for his \'resonance method for recording the magnetic properties of atomic nuclei.\''),(1056,'Andrei Ivanovich Gorchakov commanded the 1st Infanty Corps in what major engagement of the Napoleonic Wars?','Andrei Ivanovich Gorchakov commanded the 1st Infantry Corps in the Battle of Borodino in 1812, which was a major engagement of the Napoleonic Wars.'),(1057,'What was the island, on which Marinelli Glacier is located, formerly known as?','The island on which Marinelli Glacier is located was formerly known as Hoste Island. It is part of the Tierra del Fuego archipelago and is located in Chilean Patagonia.'),(1058,'What is it called when a piece of media is altered from its original state like when Bubba Sparxxx was featured in the song Oops?','The term for altering a piece of media from its original state, such as adding a feature artist to a song, is called a remix.'),(1059,'Vivian Pinn taught at which college founded in Massachusetts in 1852?','Vivian Pinn taught at Wellesley College founded in Massachusetts in 1852.'),(1060,'The Kellock-Taschereau Commission was appointed by a prime minister who served how long in office?','The Kellock-Taschereau Commission was appointed by Canadian Prime Minister William Lyon Mackenzie King, who served as the country\'s prime minister for a total of 22 years, divided into three non-consecutive terms between 1921-1930, 1935-1948, and 1949-1953.'),(1061,'Howard Van Doren Shaw was the designer of which 1917 Progressive Era community? ','Howard Van Doren Shaw was the designer of the community of Lake Forest, Illinois, which was established in 1917 during the Progressive Era.'),(1062,'When was the director of an American short slasher film with French-speaking serial killers that was released on October 31, 2011 born?','The director of the American short slasher film with French-speaking serial killers was Franck Khalfoun, who was born on July 17, 1968.'),(1063,'An 