ished monthly.'),(2093,'Who has a wider scope of profession,  José Echegaray or Graham Swift?','It is difficult to determine who has a wider scope of profession between José Echegaray and Graham Swift since they belong to different eras and have specialized in different fields. \n\nJosé Echegaray was a Spanish mathematician, playwright, and statesman. He was also a recipient of the Nobel Prize in Literature in 1904, for his dramatic works. Echegaray\'s works ranged from uplifting comedies to political dramas.\n\nGraham Swift, on the other hand, is a British author who has written several novels including Last Orders, which won the Booker prize in 1996. He is known for his literary works which generally revolve around the themes of family, relationships, and history.\n\nOverall, while Echegaray had diverse professional skills, Swift has a wider scope of profession as an author, considering his various novels and writing styles.'),(2094,'Indie studio Jumpship developed what puzzle-platform video game released in July 2010?','Jumpship is not a studio that has released any games. However, the game Limbo is a puzzle-platformer video game that was developed by Playdead and released in July 2010. Limbo has received critical acclaim for its atmospheric and poignant storytelling, gameplay mechanics, and art direction.'),(2095,'What genre does Orkworld and John Wick have in common?','Orkworld and John Wick are both examples of the action genre.'),(2096,'Are Stanley Elkin and Anne Tyler from the same country?','Yes, Stanley Elkin and Anne Tyler are both from the United States. Stanley Elkin was born in Brooklyn, New York in 1930 and Anne Tyler was born in Minneapolis, Minnesota in 1941. Both authors have contributed significantly to American literature.'),(2097,'Which genus has more species in it, Othonna or Stangeria?','Othonna is a genus of flowering plants in the sunflower family that contains around 500 species. Stangeria, on the other hand, is a genus of primitive cycads 