enwriter, and producer. Giacomo Gentilomo was also involved in the film industry as an Italian film director and screenwriter.'),(2363,'Willsmere was a railway station located in which inner suburb from Melbourne Australia?','Willsmere was a former railway station located in the inner eastern suburb of Kew in Melbourne, Australia. The station was part of the Outer Circle railway line, which operated from 1891 until its closure in 1897.'),(2364,'What was the name of the founder and president of the company which produced the role playing game FTL:2448?','The founder and former president of the company which produced the role-playing game FTL: 2448 is Marc W. Miller, who is also the creator of the game universe in which it is set.'),(2365,'Where did the Discovery Channel show franchise that Ben Bailey is an executive producer on originate from?','The Discovery Channel show franchise that Ben Bailey is an executive producer on is called \'Cash Cab\'. It originated in the United Kingdom, but it was adapted for American audiences and has since become a popular show in several other countries as well.'),(2366,'Were Daniel Mann and Todd Solondz both directors?','Yes, Daniel Mann (August 8, 1912 – November 21, 1991) and Todd Solondz (born October 15, 1959) are both film directors. Daniel Mann was an American film and television director, while Todd Solondz is an American independent filmmaker.'),(2367,'Where does the region where Jews supported by Kolel Chibas Jerusalem are from get its name?','The region where Jews supported by Kolel Chibas Jerusalem are from is called Ashkenaz. The name Ashkenaz comes from a Hebrew word meaning \'Germany,\' which is where the Ashkenazi Jewish community originally came from. Today, the term Ashkenazi refers to Jews with origins in Central and Eastern Europe.'),(2368,'Little Big Girl was a Simpsons episode directed by the animator and artist of what nationality?','\'Little Big Girl\' was the 12th episode of the 18th season of The Simpsons. 