ized place or city in Oklahoma. Therefore, there is no county seat associated with it.'),(2429,'Bullewijk metro station is part of a mixed rapid transit and light rail system that is how many km long?','The mixed rapid transit and light rail system in which Bullewijk metro station is a part of is called the Amsterdam Metro. Currently, the Amsterdam Metro has a total length of approximately 42.5 kilometers.'),(2430,'SS Ionic was built by the industrial company based in what city?','The SS Ionic was built by the Harland and Wolff shipyard, which was based in Belfast, Northern Ireland.'),(2431,'Which dog breed originates from a region farther east, the Lancashire Heeler or the Russian tracker?','The Russian Tracker breed originates from a region farther east. The Lancashire Heeler breed originated in England, while the Russian Tracker originated in Russia.'),(2432,'Which physicist known for his work on parity violation has a son who became an American chemist teaching at Cornell University?','The physicist known for his work on parity violation who has a son who became an American chemist teaching at Cornell University is named Tsung-Dao Lee. His son is named David Lee, and he was awarded the Nobel Prize in Physics in 1996 for his work on superfluidity in helium-3.'),(2433,'Which band has released more albums with their original members, Sick Puppies or Third Eye Blind?','Sick Puppies has released more albums with their original members than Third Eye Blind. Sick Puppies has released six studio albums with their original members, while Third Eye Blind has released five studio albums with their original members.'),(2434,'who starred in the English-language Danish experimental horror film  which  Lars von Triers received award for ','The English-language Danish experimental horror film you are referring to is \'The House That Jack Built\' (2018), directed by Lars von Trier. The film starred Matt Dillon as the titular character, Jack, alongside Bruno Ganz, Uma Thurman, Siobhan Fallon Hogan, Sofie Gråbøl, Riley Keough, and Jeremy Davies.'),(2435,'How often do trains run on the system which has a terminal station located at the intersection of 32nd Street and Sixth Avenue in the Herald Square neighborhood of Manhattan, New York City?','The system you are referring to is the New York City Subway. The station you mentioned is the 34th Street-Herald Square Station. Depending on the subway line that serves the station, trains can run at different frequencies during different times of the day. Generally, trains run approximately every 2-10 minutes during peak hours (weekdays from approximately 6:30 AM to 9:30 AM and 3:30 PM to 8:00 PM), and every 10-20 minutes during off-peak hours (late nights, early mornings, and weekends). It\'s recommended to check the subway schedule or use a real-time transit app for the most up-to-date information.'),(2436,'Name the 500 year-old-republic that Florentius was a praetorian prefect for. ','Florentius was a Praetorian prefect for the Roman Empire which was not a republic, but rather an empire ruled by an autocratic Caesar or Emperor. The Roman Empire lasted for more than 500 years, from 27 BCE to 476 CE.'),(2437,'Church of All Saints, Doddinghurst is part of the state church led by which person?','The Church of All Saints in Doddinghurst is part of the Church of England, which is led by the Archbishop of Canterbury, currently the Most Reverend Justin Welby.'),(2438,'Both Hatter and March Hare are characters in which book?','Hatter and March Hare are characters in the book \'Alice\'s Adventures in Wonderland\' by Lewis Carroll.'),(2439,'When Jeris Pendleton was first drafted out of college, what was the name of the field that him and his teammates played their home games on?','Jeris Pendleton was initially drafted by the Jacksonville Jaguars, but he did not play any regular-season games for them. Instead, he played in the Arena Football League (AFL) for the Alabama Vipers during the 2010 season. The Vipers played their home games at the Von Braun Center in Huntsville, Alabama.'),(2440,'What are the letters of the radio station serves the area comprising all of Belknap County, among others?','The call letters for the radio station that serves the area comprising all of Belknap County in New Hampshire varies depending on the specific radio station you are asking about. You can check the website of a specific radio station in the area to find out their call letters.'),(2441,'Which park is further south within Spain, Picos de Europa National Park or Timanfaya National Park?','Timanfaya National Park is further south in Spain than Picos de Europa National Park. Timanfaya National Park is located on the island of Lanzarote, which is part of the Canary Islands, located off the coast of Africa, while Picos de Europa National Park is located in the north of Spain, on the border between the provinces of Asturias, Cantabria, and Castilla y León.'),(2442,'In what Country is Sul America Esporte Clube in?','Sul America Esporte Clube is a football club based in Manaus, Amazonas, Brazil.'),(2443,'Are Jonathan Demme and Chris Renaud both American filmmakers?','Yes, both Jonathan Demme and Chris Renaud are American filmmakers. Jonathan Demme was an American film director, producer, and screenwriter, known for films such as \'The Silence of the Lambs\' and \'Philadelphia.\' Chris Renaud is an American animator, director, and producer, known for his work on films such as the \'Despicable Me\' franchise and \'The Secret Life of Pets.\''),(2444,'Who plays in both The True Adventures of Wolfboy and \'The Knick\'?','The actor who plays in both The True Adventures of Wolfboy and \'The Knick\' is Chris Messina.'),(2445,'The King of Hollywood starred in what 1932 American pre-Code dram film?','The King of Hollywood is not a film title, but it\'s possible that you are referring to the actor Clark Gable, who was often referred to as the \'King of Hollywood\' in the 1930s and 40s. In 1932, he starred in the film \'Red Dust,\' which is a pre-Code drama directed by Victor Fleming.'),(2446,'Which actor in the film Equus is also in the film The Informers?','Daniel Radcliffe is the actor who starred in the film Equus and also appeared in the film The Informers.'),(2447,'Dan Balan co-wrote the song from what T.I. album?','Dan Balan co-wrote the song \'Castle Walls\' from T.I.\'s seventh studio album named \'No Mercy\' that was released in 2010. The song also features American singer Christina Aguilera.'),(2448,'Who is younger Kirk Humphreys or Tom Coburn?','As of 2021, Tom Coburn is younger than Kirk Humphreys. Tom Coburn was born on March 14, 1948, and Kirk Humphreys was born on February 17, 1950.'),(2449,'Which of the following rock bands is from Chicago: Kill Hannah or Louis XIV?','Kill Hannah is from Chicago.'),(2450,'How many film were there in the series of comedy films for which Peter Rogers is best known ?','Peter Rogers is best known for producing the \'Carry On\' series of comedy films. There were a total of 31 films in the main series, starting with \'Carry On Sergeant\' in 1958 and ending with \'Carry On Emmannuelle\' in 1978.'),(2451,'Who has released more solo albums, Ozzy Osbourne or Curt Smith?','Ozzy Osbourne has released more solo albums than Curt Smith. Ozzy Osbourne has released 12 solo albums, while Curt Smith has only released 3 solo albums.'),(2452,'Are Ballota and Myosotis both evergreens?','Neither Ballota nor Myosotis are typically classified as evergreens. \n\nBallota is a deciduous or semi-evergreen shrub with aromatic leaves and white or pale pink flowers. \n\nMyosotis, also known as the Forget-Me-Not plant, is a biennial or perennial herbaceous plant that typically loses its leaves in the fall and goes dormant over the winter.'),(2453,'Which park is larger, Timanfaya National Park or Sierra Nevada National Park?','Sierra Nevada National Park is larger than Timanfaya National Park. Sierra Nevada National Park located in southern Spain has an area of approximately 862 square miles (2,236 square kilometers), while Timanfaya National Park located in the Canary Islands has an area of approximately 20 square miles (51 square kilometers).'),(2454,'Which was formed first, the duo Big & Rich or Lonestar?','Lonestar was formed first. Lonestar was formed in 1992, while Big & Rich didn\'t form until 1998.'),(2455,'Are Jeff Ragsdale and Millard Webb both authors?','I\'m not sure about Millard Webb, but Jeff Ragsdale is an author, actor, and filmmaker.'),(2456,'Who was attempting to regain the British throne until the Raids on Lachaber and Shiramore shut down his operations?','The person attempting to regain the British throne until the Raids on Lachaber and Shiramore shut down his operations was Bonnie Prince Charlie, also known as Charles Edward Stuart. He was the grandson of King James II and attempted to overthrow the British government and restore the Stuart dynasty to the throne during the Jacobite uprising of 1745.'),(2457,'What Congressional district featured Republican nomiee Willie Vaden in 2004, 2006, and 2008?','Willie Vaden was the Republican nominee for Congress in the 7th Congressional District of Virginia in 2004, 2006, and 2008.'),(2458,'What notable radio personality was born in North Bend, Oregon?','One notable radio personality who was born in North Bend, Oregon is Alex Jones. He is a controversial radio host and conspiracy theorist who hosts a daily political talk show called \'The Alex Jones Show.\''),(2459,'What\'s the familiar short name of Polyethylene terephthalate, a material used by bottle makers such as Ecopack of Pakistan?','The familiar short name of Polyethylene terephthalate is PET.'),(2460,'What is the nickname of Stephan Lichtsteiner that refers to the character from the 1994 American comedy-drama film based on the novel by Winston Groom?','Stephan Lichtsteiner\'s nickname is \'Forrest Gump\' which refers to the main character from the film.'),(2461,'During the Carnival in Rio de Janeiro who is the official singer of the samba school Mangueira?','The official singer of the samba school Mangueira during the Carnival in Rio de Janeiro is traditionally the winner of the previous year\'s samba singing competition called \'Concurso de Samba.\' They are usually known as the \'puxador\' or \'lead singer\' of the samba school. Therefore, it varies from year to year.'),(2462,'What town\'s geographic feature is the battle James Swan was twice wounded at named for?','The town is named after the Battle of Bunker Hill. James Swan was a soldier who was twice wounded at this battle during the American Revolutionary War. The battle took place on June 17, 1775, in Charlestown, Massachusetts.'),(2463,'Q: Who had more solo albums, Marty Raybon or Greg Graffin?','Greg Graffin had more solo albums than Marty Raybon. Greg Graffin has released three solo albums, while Marty Raybon has only released one solo album.'),(2464,'How many novels are there in series of novels which were adapted for a 2015 BBC TV  series in which Ruby Bentall plays a character called Verity ?','There are a total of twelve novels in the Poldark series by Winston Graham, which were adapted for a 2015 BBC TV series. Ruby Bentall played the character Verity Poldark in the show.'),(2465,'The arena in which the Adelaide Adrenaline play is also home to the world\'s first what?','The arena in which the Adelaide Adrenaline play is also home to the world\'s first purpose-built ice hockey facility in a desert climate. The facility is called the IceArenA and is located in Adelaide, South Australia.'),(2466,'The 2008 Football League Championship play-off Final was won by Hull City after a 38th minute goal from a striker who currently plays for who?','The 2008 Football League Championship play-off Final was won by Hull City after a goal from Dean Windass in the 38th minute. Dean Windass is now retired.'),(2467,'An English operatic tenor performed \'Walking in the Air\' for which 1982 animated film?','The English operatic tenor who performed \'Walking in the Air\' for the 1982 animated film was Aled Jones. The film is called \'The Snowman.\''),(2468,'How is Christopher Buckley related to the founder of \'National Review\' magazine?','Christopher Buckley is the son of William F. Buckley Jr., who founded \'National Review\' magazine in 1955.'),(2469,'which film came out first, African Cats or Fun and Fancy Free ?','Fun and Fancy Free was released first, in 1947. African Cats was released in 2011.'),(2470,'What was the name of the Danish musician who died in 1931 and who composed String Quartet No. 4 in F major or Quartet for Two Violins, Viola and Cello in F major, Opus 44 ?','The Danish musician who composed the String Quartet No. 4 in F major or Quartet for Two Violins, Viola and Cello in F major, Opus 44 is Carl Nielsen. He passed away on October 3, 1931.'),(2471,'Dream Street is narrated by an English musician, comedian, and actor who first came to public notice with what British comedy showband?','The English musician, comedian, and actor who narrates Dream Street is Neil Innes. He first came to public notice with the British comedy showband The Bonzo Dog Doo-Dah Band.');
